import React from "react";
import "../styles/Round.scss";

import { Howl } from "howler";

export default function Round({ roundNumber, roundSound }) {
  roundSound.play();

  return (
    <div className="round-screen">
      <h1>{`ROUND ${roundNumber}`}</h1>
    </div>
  );
}
